1.上传居住证 ，一直提示让上传人像面，无法上传成功。明明上传的就是人像面。

2.上传营业执照盖公章：不明白上传这个和上传社保缴费记录的区别在哪里？设置这个的意义不就是证明在北京工作吗？难道社保缴费记录不能证明吗？为什么非要让盖公章，且只有上传营业执照这一种形式，不明白意义在哪里，浪费人的时间精力。","transactTime":"2024-01-29","transactResult":"尊敬的网民朋友，您好！您反馈的问题已收悉，就您反映的问题我们已与您电话沟通解决，感谢您对我们工作的监督与支持。"}],"hasMoreItems":false}
